import React, { useContext } from 'react';

import {
    Container, InputGroup, InputText, LabelInput
} from './styles';

function Contact() {

    return (
        <Container>

            <InputGroup>
                <LabelInput htmlFor={'name'}>Nome</LabelInput>
                <InputText id={'name'} />
            </InputGroup>

            <InputGroup>
                <LabelInput htmlFor={'phone'}>Telefone</LabelInput>
                <InputText id={'phone'} />
            </InputGroup>

            <InputGroup>
                <LabelInput htmlFor={'email'}>E-mail</LabelInput>
                <InputText id={'email'} />
            </InputGroup>

        </Container>
    );
}

export default Contact;
